import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as l,c as i,a as d}from"./app-9a860c23.js";const e={},a=d('<h2 id="什么是标识符" tabindex="-1"><a class="header-anchor" href="#什么是标识符" aria-hidden="true">#</a> 什么是标识符？</h2><ul><li>在Java源程序当中凡是程序员有权利自己命名的单词都是标识符</li><li>标识符可以标识的元素： <ul><li>类名</li><li>方法名</li><li>变量名</li><li>接口名</li><li>常量名</li><li>...</li></ul></li></ul><h2 id="标识符的命名规则-【不按照这个规则来-编译器会报错-这是语法】" tabindex="-1"><a class="header-anchor" href="#标识符的命名规则-【不按照这个规则来-编译器会报错-这是语法】" aria-hidden="true">#</a> 标识符的命名规则？【不按照这个规则来，编译器会报错，这是语法】</h2><ul><li>一个合法的标识符只能由“数字、字母、下划线_、美元符号$”组成，不能含有其他符号</li><li>不能数字开头</li><li>严格区分大小写</li><li>关键字不能做标识符</li><li>理论上无长度限制，但最好不要太长</li></ul><h2 id="标识符的命名规范-【只是一种规范-不属于语法-不遵守规范编译器不会报错】" tabindex="-1"><a class="header-anchor" href="#标识符的命名规范-【只是一种规范-不属于语法-不遵守规范编译器不会报错】" aria-hidden="true">#</a> 标识符的命名规范？【只是一种规范，不属于语法，不遵守规范编译器不会报错】</h2><ul><li>最好见名知意</li><li>遵守驼峰命名方式：SystemService</li><li>类名、接口名：首字母大写，后面每个单词首字母大写</li><li>变量名、方法名：首字母小写，后面每个单词首字母大写</li><li>常量名：全部大写</li></ul><h2 id="合法和不合法发的标识符" tabindex="-1"><a class="header-anchor" href="#合法和不合法发的标识符" aria-hidden="true">#</a> 合法和不合法发的标识符</h2><table><thead><tr><th>合法</th><th>不合法</th></tr></thead><tbody><tr><td>_123Test</td><td>123Test</td></tr><tr><td>Test123</td><td>HelloWorld!</td></tr><tr><td>A_B_C</td><td>HelloWorld#</td></tr><tr><td>$ABC</td><td>Hello World</td></tr><tr><td>class1</td><td>class</td></tr><tr><td>public0</td><td>public</td></tr></tbody></table>',8),r=[a];function h(c,o){return l(),i("div",null,r)}const n=t(e,[["render",h],["__file","01_标识符.html.vue"]]);export{n as default};
